import React from "react"
import {BrowserRouter as Router} from 'react-router-dom'
import {DataProvider} from './GlobalSate'

function App() {
  return (
	<DataProvider>
		<Router>
			<div className="App">
			Hello Client
			</div>
		</Router>
	</DataProvider>
  );
}

export default App;
